import React from 'react';
import styled from 'styled-components/macro';

import ShoppingcartButton from './ShoppingcartButton';
import CategoryBlocksButton from './CategoryBlocksButton';



export default function NavigationButtonArea () {
    return (
        <NavBar>
            <ShoppingcartButton>shopping cart</ShoppingcartButton>
            <CategoryBlocksButton>categories</CategoryBlocksButton>

        </NavBar>
    )
}


const NavBar = styled.div`
    display: flex;
    height: 20vw;
    margin-bottom: 0px;
    margin-top: 30px;
    position: relative;
    bottom: 0px;
    z-index: 1;
    background: red;


`
